import React from 'react';
import './App.css';

export default function AboutMe() {
  return (
    <div className="app-container">
      <h1>عني</h1>
      <p><strong>الاسم:</strong> ممدوح</p>
      <p><strong>المنصب:</strong> مهندس ومطور</p>
      <p><strong>التعليم:</strong> طالب في الجامعة الألمانية بالقاهرة (GUC)</p>
      <p>أنا شغوف ببناء حلول برمجية، وتعلم تقنيات جديدة، وحل المشكلات الحقيقية. كطالب في الجامعة الألمانية ومهندس، أسعى لإنشاء تطبيقات مؤثرة وتحسين مهاراتي باستمرار كمطور.</p>
    </div>
  );
}
